import React from 'react';
import axios from 'axios';

class Index extends React.Component {
    constructor(props) {
        super(props)

        axios.get(baseUrl).then((res) => {
            this.setState({users: res.data.data})
        })

        this.state = {
            users: []
        }
    }

    render() {

    }
}

export default Index
